description:
Contains the album &quot;Broken Handclaps&quot; by unsigned American Dance/Electronic rock band Bearstronaut.  Also included are two earlier EPs with largely the same tracks as the album, though sometimes in better versions (for instance &quot;Pink Ladies &amp; Sassy Babies&quot;).  Previews can be found at the bands' myspace page.

Bearstronaut EP (2008). Free release by the band. LAME 3.96, average bitrate 126kbps.

Wire (EP) (2009). Free release by the band. LAME 3.97, average bitrate 219kbps.

Broken Handclaps (2009). Third party CD rip. LAME 3.98, average bitrate 259kbps.


All albums have been tagged, MP3 GAINed, and optimized with MP3packer.
